export type CallStatus = 
  | "New"
  | "Email Sent"
  | "Called - No Answer"
  | "Connected"
  | "Responded"
  | "Qualified"
  | "Meeting Scheduled"
  | "Visit Scheduled"
  | "Call Scheduled" 
  | "Demo/Presentation Complete"
  | "Proposal Sent"
  | "Negotiating"
  | "Closed Won"
  | "Closed Lost"
  | "Nurture"
  | "Follow-up Needed"
  | "No Response"
  | "DNC";

export interface EmailLog {
  id: string;
  subject: string;
  date: string;
  status: "sent" | "opened" | "replied";
}

export interface SubContact {
  id: string;
  name: string;
  role: string;
  email: string;
  phone: string;
  isPrimary?: boolean;
}

export interface Contact {
  id: string;
  name: string;
  title: string;
  company: string;
  phone: string;
  email: string;
  address: string;
  zip: string;
  city?: string;
  state?: string;
  timezone: string;
  lastNotes: string;
  dealSize?: string;
  drServed?: string; // This corresponds to the Profession Type
  status: CallStatus;
  location_lat?: number; // Mock for map
  location_lng?: number;
  emailHistory?: EmailLog[];
  clientAdmins?: SubContact[];
  providerContacts?: SubContact[];
}

export interface EmailTemplate {
  id: string;
  name: string;
  subject: string;
  body: string;
  specialty?: string; // If set, this is the default for this specialty/profession
}

export interface RecordedCall {
  id: string;
  rep: string;
  customer: string;
  duration: string;
  date: string;
  status: string;
  score: number;
  transcript?: string;
}

